import React from 'react'

const ShowVideo = () => {
    return (
       <div className="col-4 show">
                     <div className="row h-100 justify-content-center align-items-center">
                          <div className="show-logo d-flex justify-content-center align-items-center">
                              <i className='iconfont icon-video'></i>
                          </div>
                         
                     </div>  
                     <style jsx> {`
                          .show {
                             background:black;
                             height:660px;
                             border-radius:20px 0  0 20px;    
                             position:relative;                        
                          }
                          .show::after {
                              content:'';
                              position:absolute;
                              right:-20px;
                              top:0;
                              bottom:0;
                              left:80%;
                              background:black;
                              
                          }
                          .show-logo {
                              height:180px;
                              width:180px;
                              background:#4b4b4b;
                              border-radius:20px;
                          }
                          i {
                              color:white;
                              font-size:90px;
                          }
                        `}
                   </style>                                       
       </div> 
    )
}

export default ShowVideo
